(1, 'Aadhaar Enrolment', '<h1 class=\"content-heading\" style=\"margin-bottom: 15px; font-size: 26px; font-family: \" segoe=\"\" ui\",=\"\" roboto;=\"\" font-weight:=\"\" 600;=\"\" line-height:=\"\" 1.1;=\"\" color:=\"\" rgb(35,=\"\" 82,=\"\" 124);=\"\" padding:=\"\" 0px=\"\" 10px;=\"\" letter-spacing:=\"\" 0.2px;\"=\"\">Introduction</h1><p style=\"margin-bottom: 10px; color: rgb(84, 110, 122); font-family: \" segoe=\"\" ui\",=\"\" roboto;=\"\" font-size:=\"\" 14px;=\"\" letter-spacing:=\"\" 0.2px;\"=\"\">The Aadhaar enrolment process includes visiting Enrolment Centre, filling the enrolment form, getting demographic and biometric data captured, submitting proof of Identity and address documents, before collecting acknowledgement slip containing Enrolment ID. </p><p style=\"margin-bottom: 10px; color: rgb(84, 110, 122); font-family: \" segoe=\"\" ui\",=\"\" roboto;=\"\" font-size:=\"\" 14px;=\"\" letter-spacing:=\"\" 0.2px;\"=\"\"><img src=\"data:image/png;base64,\" style=\"width: 707.986px;\" data-filename=\"capturing_demographic_and_biometric.png\"><br></p><p style=\"margin-bottom: 10px; color: rgb(84, 110, 122); font-family: \" segoe=\"\" ui\",=\"\" roboto;=\"\" font-size:=\"\" 14px;=\"\" letter-spacing:=\"\" 0.2px;\"=\"\"><b>Adhaar Enrolment Steps</b></p><p style=\"margin-bottom: 10px; color: rgb(84, 110, 122); font-family: \" segoe=\"\" ui\",=\"\" roboto;=\"\" font-size:=\"\" 14px;=\"\" letter-spacing:=\"\" 0.2px;\"=\"\">The highlights of Aadhaar enrolment are:</p><ul style=\"margin-right: 0px; margin-bottom: 5px; margin-left: 17px; padding: 0px; color: rgb(84, 110, 122); font-family: \" segoe=\"\" ui\",=\"\" roboto;=\"\" font-size:=\"\" 14px;=\"\" letter-spacing:=\"\" 0.2px;\"=\"\"><li style=\"margin-top: 5px; margin-bottom: 5px; padding-left: 10px; list-style: square;\"><span class=\"li-text\">Aadhaar enrolment is free of cost.</span></li><li style=\"margin-top: 5px; margin-bottom: 5px; padding-left: 10px; list-style: square;\"><span class=\"li-text\">You can go to any authorized&nbsp;<a href=\"https://appointments.uidai.gov.in/easearch.aspx\" target=\"_blank\" rel=\"noopener noreferrer\" style=\"color: rgb(1, 1, 120); cursor: pointer;\">Aadhaar enrolment centre&nbsp;</a>anywhere in India with your proof of identity and proof of address documents</span></li><li style=\"margin-top: 5px; margin-bottom: 5px; padding-left: 10px; list-style: square;\"><span class=\"li-text\">UIDAI process accepts&nbsp;<span style=\"font-weight: 700; color: rgb(37, 127, 41);\">wide range of PoI (Proof of Identity) and PoA (Proof of Address) documents.</span>&nbsp;View the&nbsp;<a href=\"https://uidai.gov.in/images/commdoc/valid_documents_list.pdf\" target=\"_blank\" rel=\"noopener noreferrer\" style=\"color: rgb(1, 1, 120); cursor: pointer;\">list of supporting documents</a>. Common proofs of identity and address are election photo ID card, Ration card, passport and driving license.</span></li><li style=\"margin-top: 5px; margin-bottom: 5px; padding-left: 10px; list-style: square;\"><span class=\"li-text\">Photo ID cards like PAN card and Govt ID cards are permissible for identity proof. Address proof documents also include water - electricity - Landline telephone bills for the last three months.</span></li><li style=\"margin-top: 5px; margin-bottom: 5px; padding-left: 10px; list-style: square;\"><span class=\"li-text\">In case you do not have above common proofs, Certificate of Identity having photo issued by Gazetted Officer/Tehsildar&nbsp;certificate proforma as prescribed by UIDAI&nbsp;is also accepted as PoI. Certificate of Address having photo issued by MP or MLA /Gazetted Officer/Tehsildar on letterhead or by Village Panchayat head or its equivalent authority (for rural areas) is accepted as valid PoA.&nbsp;</span><span class=\"li-text\">Even if someone in a family does not have individual valid documents, the resident can still enrol if his/her name exists in family entitlement document. In this case the&nbsp;<span style=\"font-weight: 700; color: rgb(37, 127, 41);\">Head of Family</span>&nbsp;in entitlement document needs to be enrolled first with valid PoI &amp; PoA document. The head of the Family can then introduce other members in the family while they are enrolling. UIDAI accepts many document types as Proof of Relationship. Please&nbsp;<a href=\"https://uidai.gov.in/images/commdoc/valid_documents_list.pdf\" target=\"_blank\" rel=\"noopener noreferrer\" style=\"color: rgb(1, 1, 120); cursor: pointer;\">View the list of supporting documents.</a>.</span></li><li style=\"margin-top: 5px; margin-bottom: 5px; padding-left: 10px; list-style: square;\"><span class=\"li-text\">Where there are no documents available, resident may also take the help of Introducers available at the enrolment centre. The&nbsp;<span style=\"font-weight: 700; color: rgb(37, 127, 41);\">Introducers</span>&nbsp;are notified by the Registrar. For further details please contact office of the concerned Registrar.</span></li></ul><h2 id=\"Enrollment-types-approaches\" style=\"font-family: \" segoe=\"\" ui\",=\"\" roboto;=\"\" font-weight:=\"\" 600;=\"\" line-height:=\"\" normal;=\"\" color:=\"\" rgb(38,=\"\" 50,=\"\" 56);=\"\" margin:=\"\" 10px=\"\" 0px;=\"\" font-size:=\"\" 20px;=\"\" padding:=\"\" 0px=\"\" 5px;=\"\" letter-spacing:=\"\" 0.2px;\"=\"\">To summarise, there are three approaches for enrolment:</h2><h3 style=\"font-family: \" segoe=\"\" ui\",=\"\" roboto;=\"\" font-weight:=\"\" 600;=\"\" line-height:=\"\" normal;=\"\" color:=\"\" rgb(38,=\"\" 50,=\"\" 56);=\"\" margin:=\"\" 10px=\"\" 0px=\"\" 0px;=\"\" font-size:=\"\" 18px;=\"\" padding:=\"\" 10px;=\"\" letter-spacing:=\"\" 0.2px;\"=\"\">Document Based</h3><ul style=\"margin-right: 0px; margin-bottom: 5px; margin-left: 17px; padding: 0px; color: rgb(84, 110, 122); font-family: \" segoe=\"\" ui\",=\"\" roboto;=\"\" font-size:=\"\" 14px;=\"\" letter-spacing:=\"\" 0.2px;\"=\"\"><li style=\"margin-top: 5px; margin-bottom: 5px; padding-left: 10px; list-style: square;\">Submission of one valid Proof of Identity (PoI) document and one valid Proof of Address(PoA) document</li></ul><h3 style=\"font-family: \" segoe=\"\" ui\",=\"\" roboto;=\"\" font-weight:=\"\" 600;=\"\" line-height:=\"\" normal;=\"\" color:=\"\" rgb(38,=\"\" 50,=\"\" 56);=\"\" margin:=\"\" 10px=\"\" 0px=\"\" 0px;=\"\" font-size:=\"\" 18px;=\"\" padding:=\"\" 10px;=\"\" letter-spacing:=\"\" 0.2px;\"=\"\">Head Of Family (Hof)-based</h3><ul style=\"margin-right: 0px; margin-bottom: 5px; margin-left: 17px; padding: 0px; color: rgb(84, 110, 122); font-family: \" segoe=\"\" ui\",=\"\" roboto;=\"\" font-size:=\"\" 14px;=\"\" letter-spacing:=\"\" 0.2px;\"=\"\"><li style=\"margin-top: 5px; margin-bottom: 5px; padding-left: 10px; list-style: square;\">Head of family (HoF) may introduce family members by means of documents, which establish the Proof of Relationship (PoR).</li></ul><h3 style=\"font-family: \" segoe=\"\" ui\",=\"\" roboto;=\"\" font-weight:=\"\" 600;=\"\" line-height:=\"\" normal;=\"\" color:=\"\" rgb(38,=\"\" 50,=\"\" 56);=\"\" margin:=\"\" 10px=\"\" 0px=\"\" 0px;=\"\" font-size:=\"\" 18px;=\"\" padding:=\"\" 10px;=\"\" letter-spacing:=\"\" 0.2px;\"=\"\">Introducer-based</h3><ul style=\"margin-right: 0px; margin-bottom: 5px; margin-left: 17px; padding: 0px; color: rgb(84, 110, 122); font-family: \" segoe=\"\" ui\",=\"\" roboto;=\"\" font-size:=\"\" 14px;=\"\" letter-spacing:=\"\" 0.2px;\"=\"\"><li style=\"margin-top: 5px; margin-bottom: 5px; padding-left: 10px; list-style: square;\">In the absence of valid Proof of Identity (PoI) document and valid Proof of Address (PoA) document, an introducers service can be leveraged. An introducer is a person appointed by the Registrar and should have a valid Aadhaar number .</li></ul><ul style=\"margin-right: 0px; margin-bottom: 5px; margin-left: 17px; padding: 0px; color: rgb(84, 110, 122); font-family: \" segoe=\"\" ui\",=\"\" roboto;=\"\" font-size:=\"\" 14px;=\"\" letter-spacing:=\"\" 0.2px;\"=\"\"><li style=\"margin-top: 5px; margin-bottom: 5px; padding-left: 10px; list-style: square;\"><span class=\"li-text\">At the enrolment Centre, please fill your personal details within the Enrolment Form. Your photo, finger-prints and iris scan will also be taken as a part of the enrolment. You can review the details you have provided and make corrections during enrolment itself. You will get an acknowledgement slip with an enrolment number and other details captured during enrolment. Any correction in the enrolment data can be done within 96 hours of enrolment by visiting the enrolment centre with the acknowledgement slip.</span></li><li style=\"margin-top: 5px; margin-bottom: 5px; padding-left: 10px; list-style: square;\"><span class=\"li-text\">You need to enrol only once, as multiple enrolments will result in rejections unless it is advised by UIDAI.</span></li><li style=\"margin-top: 5px; margin-bottom: 5px; padding-left: 10px; list-style: square;\"><span class=\"li-text\">The waiting time for Aadhaar may vary from 60-90 days after receipt of resident data packets in CIDR.</span></li><h3 id=\"How-to-Enroll\" style=\"font-family: &quot;Segoe UI&quot;, Roboto; font-weight: 600; line-height: normal; color: rgb(38, 50, 56); margin: 10px 0px 0px; font-size: 18px; padding: 0px 0px 10px; letter-spacing: 0.2px;\"><span style=\"letter-spacing: 0.2px;\">Where to Enrol</span></h3><p style=\"margin-bottom: 10px; font-family: &quot;Segoe UI&quot;, Roboto; font-size: 14px; letter-spacing: 0.2px;\">Enrolment in all the states/UTs is being covered by<span style=\"font-weight: 700; color: rgb(37, 127, 41);\">&nbsp;UIDAI&nbsp;</span>and&nbsp;<span style=\"font-weight: 700; color: rgb(37, 127, 41);\">Office of the Registrar General of India (RGI).</span>&nbsp;Aadhaar Enrolment activities are being carried out exclusively by&nbsp;<span style=\"font-weight: 700; color: rgb(37, 127, 41);\">RGI</span>&nbsp;along with preparation of National Population Register&nbsp;<span style=\"font-weight: 700; color: rgb(37, 127, 41);\">(NPR)</span>&nbsp;in Assam and Meghalaya. Residents of all other states/UTs are required to enrol only at an&nbsp;<a href=\"http://appointments.uidai.gov.in/easearch.aspx\" target=\"_blank\" rel=\"noopener noreferrer\" style=\"color: rgb(1, 1, 120); cursor: pointer;\">Aadhaar Enrolment Centre/Aadhaar Camps or at any Permanent Enrolment Centre.<br></a></p></ul><p></p>\"', 'Sruthi S. Udupa', 'capturing_demographic_and_biometric.png', '2022-09-15 00:00:00');
INSERT INTO `featured` (`featuredid`, `title`, `details`, `author`, `picture`, `uploadedon`) VALUES
(2, 'Adhaar Enrolment Unites Speech-impaired Boy with his Family', '<p><strong>Introduction</strong></p>\r\n\r\n<p>&nbsp;Had it not been for his Aadhaar card enrolment, Sangma Gante from Latur district in&nbsp;<a href=\"https://timesofindia.indiatimes.com/india/maharashtra\">Maharashtra</a>&nbsp;would have never been reunited with her hearing- and speech-impaired orphan brother Sanjay. Sanjay, who had left their house in Henchal village of Latur after a fight with his elder brother in 2014, was recently reunited with the family, in&nbsp;<a href=\"https://timesofindia.indiatimes.com/topic/rajpipla\">Rajpipla</a>&nbsp;town of&nbsp;<a href=\"https://timesofindia.indiatimes.com/topic/narmada-river\">Narmada</a>&nbsp;district after officials there found his details on the government website.<br />\r\nAfter his parents died in 2011, Sangma had been taking care of him.</p>\r\n\r\n<p style=\"text-align: center;\"><img src=\"images/speech-impairedboy.jpg\" width=150 height=150></img></p>\r\n\r\n<p><strong>Incident</strong><br />\r\nOn March 22 last year, the Vadodara railway police found Sanjay, then 11, loitering around alone on the railway station. Efforts to locate his family proved futile as he could not communicate. He was sent to Vadodara-based Don Bosco Shehalaya where he was kept for 15 days.<br />\r\nLater, he was shifted to the government-run deaf and mute residential school run by Bal Suraksha Ayog at Rajpipla. Narmada district child protection officer Chetan Parmar said, &quot;We also tried to get some clue or information from him about his home but in vain. We decided to name him Aakash and admitted him in class II.&quot; Parmar added that since it was mandatory to have Aadhaar enrolments for all children, a camp was organised in January 2017 where a finger print and retina scan was done for all students.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>After a week, when all other students&#39; enrolment was successful, only Aakash&#39;s registration was missing. On checking the Aadhaar website, it came to light that the details duplicated. On checking further, his Aadhaar enrolment of year 2011 was displayed along with the photograph and details of Sanjay Nagnath Yenkur.</p>\r\n', 'Balakrishnan L', 'speech-impairedboy.jpg', '2022-08-27 00:00:00'),
(3, 'How Automation Can Help Your Business', '<p>I remember getting started on my entrepreneurial journey. There was so much to do, and never enough time. As the business grew, I realized that one of the ways to make the most impact and initiate growth in the organization was through automation and delegation. At first, automation can seem daunting and a little scary, but once you see the results, it can be a game changer.</p>\r\n<p style=\"text-align: center;\"><img src=\"images/automation.jpg\" width=200 height=200></img></p>\r\n\r\n<p><strong>The Benefits Of Automation</strong></p>\r\n\r\n<p>Using automation to perform repetitive tasks can be a huge timesaver. The ability to &quot;set and forget&quot; certain aspects of the business give us greater freedom to pursue those areas that need our attention. Think about working on the business rather than in the business.</p>\r\n\r\n<p>It can also lead to greater profitability in your company. Save money on labor hours by automating certain tasks such as drip campaigns, follow-up sequences and bill pay. The right automations in your business also contribute to an increase in productivity. When all of your processes and workflows are in place, you can find opportunities for automation that allow team members the freedom to work on the important tasks that need hands-on attention. With this increased productivity, you can ensure your business is always moving forward and nothing is being left behind.</p>\r\n\r\n<p>When you set up automated tasks, there is less risk of error, which can save you both time and money. Consider using automation apps for your social media posts to ensure you don&#39;t miss getting content out promptly. You may also want to implement automation in your bookkeeping process by using software that allows charges to be imported with a click of a button, rather than making entries by hand. Automated drip campaigns ensure efficient communication in that the prospects and current customers in your pipelines are being contacted regularly</p>\r\n\r\n<p>Remember the days of stuffing envelopes and hand-addressing letters to potential sellers? Mail houses now provide automated versions of both of these tasks. In addition, automated communication can lead to a better customer experience, since they are being responded to promptly. Utilizing a good CRM system is a great way to introduce automation into your business. The CRM system can manage your contacts and communications, provide insight into your KPIs, track your marketing and manage your leads. All of these things contribute to the overall efficiency of your organization.</p>\r\n\r\n<p>Automation has helped my organization through automated email and text drip sequences for a follow-up to ensure that no lead is ever left behind. We also use automation to set and confirm appointments with sellers. In marketing, we use it for our direct mail campaigns and responding to potential sellers on social platforms. In hiring, we use automation to help sort and communicate with potential job candidates.</p>\r\n\r\n<p>.</p>\r\n\r\n<p><strong>Getting Started With Automation</strong></p>\r\n\r\n<p>If you are considering using automation in your business for the first time, there are a few points to consider. The first is the ease of use. Make sure the software or service you are using makes your life easier, not more complicated. The second thing to consider is what&#39;s causing you the biggest pain point right now. Is there automation out there that can solve a problem in your business? I would also recommend taking a look at where you are in your business. Are you running in 50 different directions with no help or extra time? Consider what automation you can implement to help you get your time back.</p>\r\n\r\n<p>There are several ways you can identify areas of your business to utilize automation. Look for repetitive tasks. Look at your manpower availability. Do you have enough people on your team right now to do all of the daily tasks that need to be done?</p>\r\n\r\n<p>Automation can help when you&#39;re a small team or an individual running the business. The most important place to look is at your processes. Where are the points of failure? Where are the errors occurring? By identifying those deficiencies and replacing them with automation, you can correct and improve those processes leading to greater overall efficiency in the business.</p>\r\n\r\n<p><strong>Looking Ahead</strong></p>\r\n\r\n<p>Long-term benefits of implementing automation include increased profitability, accountability, productivity, and flexibility. It can help you get your time back, reduce errors in your processes and even increase sales and lead generation. These factors contribute to your bottom line and the overall health of your organization. Once you can identify areas where automation can help, don&#39;t be afraid to use it. In business, it&#39;s often these small adjustments that can move you forward and lead you to success.</p>\r\n', 'Indira S. Udupa', 'automation.jpg', '2022-08-27 00:00:00');
INSERT INTO `featured` (`featuredid`, `title`, `details`, `author`, `picture`, `uploadedon`) VALUES
(4, 'Automation Definition Getting Implemented - Revisited', '<p style=\"color: rgb(0, 0, 0); font-family: Lato, Roboto, -apple-system, BlinkMacSystemFont, \" segoe=\"\" ui\",=\"\" \"helvetica=\"\" neue\",=\"\" arial,=\"\" sans-serif,=\"\" \"apple=\"\" color=\"\" emoji\",=\"\" \"segoe=\"\" ui=\"\" symbol\";=\"\" font-size:=\"\" 16px;\"=\"\"><b>Introduction</b></p><p style=\"color: rgb(0, 0, 0); font-family: Lato, Roboto, -apple-system, BlinkMacSystemFont, \" segoe=\"\" ui\",=\"\" \"helvetica=\"\" neue\",=\"\" arial,=\"\" sans-serif,=\"\" \"apple=\"\" color=\"\" emoji\",=\"\" \"segoe=\"\" ui=\"\" symbol\";=\"\" font-size:=\"\" 16px;\"=\"\">We will be streaming and revisiting \"How to Get Automation Included in Your Definition of Done\" a previous TestBash talk still relevant for many people in our community today. And the best about it is that Angie Jones will be online to let you know what has changed and answer your questions about what you have learned since!</p><p style=\"color: rgb(0, 0, 0); font-family: Lato, Roboto, -apple-system, BlinkMacSystemFont, \" segoe=\"\" ui\",=\"\" \"helvetica=\"\" neue\",=\"\" arial,=\"\" sans-serif,=\"\" \"apple=\"\" color=\"\" emoji\",=\"\" \"segoe=\"\" ui=\"\" symbol\";=\"\" font-size:=\"\" 16px;\"=\"\"><img src=\"data:image/jpeg;base64,\" style=\"width: 727.778px;\" data-filename=\"automation-revisited.jpg\"><br></p><p style=\"color: rgb(0, 0, 0); font-family: Lato, Roboto, -apple-system, BlinkMacSystemFont, \" segoe=\"\" ui\",=\"\" \"helvetica=\"\" neue\",=\"\" arial,=\"\" sans-serif,=\"\" \"apple=\"\" color=\"\" emoji\",=\"\" \"segoe=\"\" ui=\"\" symbol\";=\"\" font-size:=\"\" 16px;\"=\"\"><b>Automation Review</b></p><p style=\"color: rgb(0, 0, 0); font-family: Lato, Roboto, -apple-system, BlinkMacSystemFont, \" segoe=\"\" ui\",=\"\" \"helvetica=\"\" neue\",=\"\" arial,=\"\" sans-serif,=\"\" \"apple=\"\" color=\"\" emoji\",=\"\" \"segoe=\"\" ui=\"\" symbol\";=\"\" font-size:=\"\" 16px;\"=\"\">While most teams appreciate the benefits of automation, it is commonly viewed as too time-consuming to be considered as part of an agile sprint; resulting in automation being done in isolation and typically months after the story has been closed. There are several problems with this approach. The automation team members are not as familiar with the requirements as team members who were engaged within the sprint, which could result in them missing key aspects while testing. Automated regression testing of the features doesnt take place until far too long after the feature has been delivered which means more manual regression and/or a period where new features are being introduced but no regression is taking place.</p><p style=\"color: rgb(0, 0, 0); font-family: Lato, Roboto, -apple-system, BlinkMacSystemFont, \" segoe=\"\" ui\",=\"\" \"helvetica=\"\" neue\",=\"\" arial,=\"\" sans-serif,=\"\" \"apple=\"\" color=\"\" emoji\",=\"\" \"segoe=\"\" ui=\"\" symbol\";=\"\" font-size:=\"\" 16px;\"=\"\"><b>Testimonial</b></p><p style=\"color: rgb(0, 0, 0); font-family: Lato, Roboto, -apple-system, BlinkMacSystemFont, \" segoe=\"\" ui\",=\"\" \"helvetica=\"\" neue\",=\"\" arial,=\"\" sans-serif,=\"\" \"apple=\"\" color=\"\" emoji\",=\"\" \"segoe=\"\" ui=\"\" symbol\";=\"\" font-size:=\"\" 16px;\"=\"\">Join Angie Jones as she discusses agile-friendly approaches to test automation which will allow teams to close their sprints with automation in place. These automation techniques allow scrum teams to work smarter, not harder, and find bugs quicker with a more narrowed scope of the root cause, essentially leading to quicker resolution times. Angie will also walk through an example Story and demonstrate how to apply these techniques to ensure automation is achievable within the sprint.</p><p></p>\"', 'Shruti Udupa', 'automation-revisited.jpg', '2022-09-15 00:00:00');

