(12, 'Extreme climate amplified the reptile revolution', '<p><b>Introduction</b></p><p>Theres nothing like a big mass extinction to open up ecological niches and clear out the competition, accelerating evolution for some lucky survivors. Or is there? A new study suggests that the rate of climate change may play just as large a role in speeding up evolution.</p>\r\n\r\n<p>The study focuses on reptile evolution across 57 million years  before, during, and after&nbsp;<a href=\"https://www.sciencenews.org/article/volcanic-eruptions-depleted-ocean-oxygen-may-have-set-great-dying\">the mass extinction</a>&nbsp;at the end of the Permian Period (<em>SN: 12/6/18</em>)<em>.</em>&nbsp;That extinction event, triggered by carbon dioxide pumped into the atmosphere and oceans through an increased volcanic activity about 252 million years ago, knocked out a whopping 86 percent of Earths species. Yet reptiles recovered from the chaos relatively well. Their exploding diversity of species around that time has been widely regarded as a result of their slithering into newly available niches.</p>\r\n<p style=\"text-align: center\"><img alt=\"\" src=\"http://localhost/myblog/images/reptile-evolution.jpg\" style=\"border-style:solid; border-width:2px; height:283px; margin:2px; width:480px\"></p>\r\n<p>But rapid climate fluctuations were already taking place much earlier in the Permian, and so were surges of reptile diversification, researchers say. Analyzing fossils from 125 reptile species shows that bursts of evolutionary diversity in reptiles&nbsp;<a href=\"http://www.science.org/doi/10.1126/sciadv.abq1898\">were tightly correlated with relatively rapid fluctuations in climate</a>&nbsp;throughout the Permian and millions of years into the next geologic period, the Triassic, researchers report on August 19 in&nbsp;<em>Science Advances</em>.</p><p><b>Studies</b></p>\r\n\r\n<p>Scientists understanding of evolution is expanding as they become more tuned into the connection between it and environmental change, says Jessica Whiteside, a geologist at the University of Southampton in England who works on mass extinctions but was not involved in the new work. This study is bound to become an important part of that conversation.</p>\r\n\r\n<p>To investigate reptile evolution, evolutionary paleobiologist Tiago Simes of Harvard University and colleagues precisely measured and scanned reptile fossils ranging from 294 million to 237 million years old. In all, the researchers examined 1,000 specimens at 50 research institutions in 20 countries. &nbsp;For climate data, the team used an&nbsp;<a href=\"https://www.nature.com/articles/s41467-021-25019-2\">existing large database of sea surface temperatures</a>&nbsp;based on oxygen isotope data, extending back 450 million years, published in 2021.</p>\r\n\r\n<p>By closely tracking changes in the body and head size and shape in so many species, paired with that climate data, the researchers found that the faster the rate of climate change, the faster reptiles evolved. The fastest rate of reptile diversification did not occur at the end-Permian extinction, the team found, but several million years later in the Triassic, when climate change was at its most rapid and global temperatures witheringly hot. Ocean surface temperatures during this time soared to 40 Celsius, or 104 Fahrenheit  about the temperature of a hot tub, says Simes.</p>\r\n\r\n<p>A few species did evolve less rapidly than their kin, Simes says. The difference? Size. For instance, he says that reptiles with smaller body sizes are already preadapted to live in rapidly warming climates. Due to their greater surface area to body ratio, small-bodied reptiles can better exchange heat with their surrounding environment, so stay relatively cooler than larger animals.</p><p><b>Conclusion</b></p>\r\n\r\n<p>The smaller reptiles were being forced by natural selection to stay the same, while during that same period, the large reptiles were being told by natural selection You need to change right away or youre going to go extinct, Simes says.</p>\r\n\r\n<p>This phenomenon, called the Lilliput effect, is not a new proposal, Simes says, adding that its been well established in marine organisms. But its the first time its been quantified&nbsp;in limbed vertebrates across this critical period in Earths history.</p>\r\n\r\n<p>Simes and colleagues detailed work has refined the complex evolutionary tree for reptiles and their ancestors. But, for now, its unclear which played a bigger role in reptile evolution long ago  all those open ecological niches after the end-Permian mass extinction, or the dramatic climate fluctuations outside of the extinction event.</p>\r\n\r\n<p>We cannot say which one was more important, Simes says. Without either one, the course of evolution in the Triassic and the rise of reptiles to global dominance in terrestrial ecosystems would have been quite different.&nbsp;</p>\r\n\"\"\"', 'Sandhya K.G.', '2022-09-13 00:00:00', 'nature-image.jpg'),
(16, 'iQoo Z6x to come with Qualcomm Snapdragon 778 Plus chipset', '<p><strong>Introduction</strong></p>\r\n\r\n<p>Chinese smartphone maker iQoo has confirmed that it will launch the Z6 series smartphones on August 25. The leaks and rumours about the smartphone have already been floating on the internet. However, ahead of the official announcement, new details about the smartphone has arrived from the companys end.</p>\r\n\r\n<p style=\"text-align: center;\"><img src=\"http://localhost/myblog/images/chipset.jpg\" style=\"width: 250px; height: 250px;\"></p>\r\n\r\n<p><strong>Gadget</strong><br>\r\n<br>\r\nGizmochaina has reported that iQoo has revealed a couple of specifications and features of its upcoming smartphone -- iQoo Z6. The first thing that the company has confirmed is that the smartphone will be powered by Qualcomm Snapdragon 778G Plus Mobile Platform.</p>\r\n\r\n<p>Apart from this, the company has also mentioned that the handset will come with LPDDR5 RAM and UFS 3.1 storage. Both the specifications are top notch and the chipset weve already seen in action in the recently launched Nothing Phone (1) which does a decent job at handling things.</p>\r\n\r\n<p>Coming back to the details revealed by the company, the iQoo Z6 will also come with six-layered ice-colled liquid cooling technology for better thermal management.<br>\r\n<br>\r\nEarlier the company has already confirmed that the handset will support 80W fast charging. As per companys claim, it will charge the handset from 0 to 50 per cent in just 10 minutes.</p><p><br><b>\r\nLikely Features</b></p><p>Based on the previous leaks and rumours, the iQoo Z6 will feature a 6.64-inch LCD display with a punch-hole for the selfie camera. The panel will have a full HD resolution and it is expected to support a 120Hz refresh rate. As far as variants are concerned, the handset is likely to come with up to 12GB RAM and 256GB storage.</p>\r\n\r\n<p>Follow Gadgets Now on &nbsp;<a href=\"https://www.facebook.com/GadgetsNow\">Facebook</a>&nbsp; and &nbsp;<a href=\"https://twitter.com/gadgetsnow\">Twitter</a>. &nbsp; For the&nbsp;<a href=\"https://www.gadgetsnow.com/mobile-phones\">latest mobile phones</a>&nbsp;<a href=\"https://www.gadgetsnow.com/upcoming-mobile-phones\">upcoming mobiles</a>, &nbsp;<a href=\"https://www.gadgetsnow.com/reviews\">reviews</a>, &nbsp;<a href=\"https://www.gadgetsnow.com/compare-mobile-phones\" target=\"_blank\">comparisons</a>&nbsp;and more check out Gadgetsnow.com</p>\r\n\"', 'Sandhya K.G.', '2022-09-14 00:00:00', 'automation-robot.jpg'),
(18, 'James Webb Telescope Captures Stunning New Jupiter Images', '<p>The images of Jupiter, the largest planet in the solar system, have always been the same. A yellowish-orange sphere is how most of us remember the gas giant from our school textbooks and encyclopedias. However, the new images of Jupiter captured by NASA&rsquo;s newest James Webb telescope show the planet in a very different avatar.</p>\r\n\r\n<p>A greenish blue view of Jupiter can be seen in the latest infrared images of the planet released by NASA. The images show the planet complete with all its signature elements including the giant storms, auroras and regions of extreme temperature. Check out the images below.</p>\r\n\r\n<p style=\"text-align: center\"><img alt=\"jupiter first picture\" src=\"http://localhost/myblog/images/Jupiter-first.jpg\" style=\"border-style:solid; border-width:2px; width: 286px; height:286px; margin:2px; width:680px\" />\r\n\r\n<p>&ldquo;We hadn&rsquo;t really expected it to be this good, to be honest,&rdquo; planetary astronomer Imke de Pater said in a press statement. De Pater, professor emerita of the University of California, Berkeley led the observations of Jupiter with Paris Observatory professor Thierry Fouchet, who added that &ldquo;It&rsquo;s really remarkable that we can see details on Jupiter together with its rings, tiny satellites, and even galaxies in one image.&rdquo;</p>\r\n\r\n<p style=\"text-align: center\"><img alt=\"Second Jupiter picture\" src=\"http://localhost/myblog/images/Jupiter.jpg\" style=\"border-style:solid; border-width:3px; width: 286px; height:254px; margin:3px; width:759px\" /></p>\r\n\r\n<p>A second image released by NASA also neatly marks the various features of Jupiter that can be seen in the pictures, including the planet&rsquo;s rings and moons. &ldquo;This one image sums up the science of our Jupiter system program, which studies the dynamics and chemistry of Jupiter itself, its rings, and its satellite system,&rdquo; Fouchet said.</p>\r\n\r\n<h2><strong>Processing Jupiter&rsquo;s newest photographs</strong></h2>\r\n\r\n<p>As NASA mentions in its&nbsp;<a href=\"https://blogs.nasa.gov/webb/2022/08/22/webbs-jupiter-images-showcase-auroras-hazes/?utm_source=TWITTER&amp;utm_medium=NASA&amp;utm_campaign=NASASocial&amp;linkId=178229025\" target=\"_blank\">blog post</a>, images from the James Webb telescope don&rsquo;t arrive in the form we see them in on the web. Instead, what scientists get is a collection of information captured by the light detectors on the James Webb Space Telescope. At the STScI (Space Telescope Science Institute), these bits of information are then processed and compiled to make the images we see.</p>\r\n\r\n<p>The newest images of Jupiter you just witnessed were processed by Judy Schmidt of Modesto California, a longtime image processor in the citizen science community.</p>\r\n\r\n<p>Schmidt also collaborated with Spain-based co-investigator Ricardo Hueso, who studies planetary atmospheres at the University of the Basque Country for the second image, the one where the rings and moons can be seen.</p>\r\n', 'L. Balakrishnan', '2022-08-24 00:00:00', 'Jupiter.jpg'),
